import styled from "styled-components";

function Freezer() {
  return (
    <Main>
      <div className="container">
        <div className="top">
          <h1>Jay님의 냉동실</h1>
          <div>재료 맵핑 + 재료추가 직접버튼?</div>
        </div>
        <div>
          <button>재료 추가하기 ╋</button>
        </div>
      </div>
    </Main>
  );
}

export const Main = styled.div`
  background-color: blanchedalmond;
  height: 92.5vh;
  overflow-y: hidden;
`;

export default Freezer;
